                {
            name :"Time",
            time:"3:22",
            image:{image},
            artist:"John"
        },
    ])  

    return (
        <div className="flex flex-col h-full">
            <div className="text-white mb-4 mt-16 ml-24 text-2xl">
                <p className="font-bold">Your Results :</p>
            </div> 
            <div className="flex flex-col flex-wrap text-white gap-4 overflow-x-auto ml-16 mt-12">
                {tracks.map((track ) => (
                    <div key={track}>
                        <Song 
                            name={track.name}
                            time ={track.time}
                            image={image}
                            artist={track.artist}
                            />
                    </div>
                ))}
            </div>
        </div>
    )
}

export default SearchHandler
